REM INSERTING into OPEN_ACCESS.M_FEEDER
SET DEFINE OFF;
commit;

CREATE OR REPLACE PROCEDURE FIND_SS_ID AS 
BEGIN

FOR i IN (
select f.id f_id, f.ss_name, s.id from open_access.m_feeder f, open_access.m_substation s
where f.ss_name = s.name
) LOOP
      update open_access.m_feeder set m_substation_id = i.id where ss_name = i.ss_name;
    END LOOP;

END FIND_SS_ID;



CREATE OR REPLACE PROCEDURE TEMP_MIGRATION_FILL_IDS AS 
BEGIN

FOR i IN (
select id, name from open_access.m_substation s
) LOOP
      update open_access.temp_substation_master set m_substation_id = i.id where wg_ssname = i.name;
   END LOOP;

END TEMP_MIGRATION_FILL_IDS;

